import React from 'react'
import { Label } from "semantic-ui-react"
const Profile = (props) => {
    return (
        <div style={{ float: "right", marginRight: "2vw"}}>
            <Label size="huge" as='a' content={props.Name} image={"../../logo.svg"}/>
        </div>

    )
}

export default Profile
